@RequestScoped
@Path("story")
public class StoryService {

    @GET
    @Produces(MediaType.APPLICATION_JSON)
    public Story getSimpleStory() {
        Story story = new Story();
        story.setText("Am 05.06.2017 wurden wir um 22:45 mit Sirene und Pager und Handyalarmierung nach starkem Regenfall zu einem Wasserschaden in die Bachstraße alarmiert. Unsere Aufgabe bestand die Garage Wasser frei zu bekommen dieses bewältigten wir mit unserem Nasssauger und Abzieher. Nach einer Dreiviertel stunde konnten wir wieder einsatzbereit ins Feuerwehrhaus einrücken.");

        story.getImages().add(convertImgToByteArray("image1.jpg"));
        story.getImages().add(convertImgToByteArray("image2.jpg"));
        story.getImages().add(convertImgToByteArray("image3.jpg"));
        story.getImages().add(convertImgToByteArray("image4.jpg"));
        story.getImages().add(convertImgToByteArray("image5.jpg"));

        System.out.println("Test is called");
        return story;
    }
    @GET()
    @Path("meta")
    @Produces(MediaType.APPLICATION_JSON)
    public StoryMetaData getStoryMetaData(){
        StoryMetaData data= new StoryMetaData();
        data.setAmountOfStories(2);
        
        return data;
    }

    private String convertImgToByteArray(String imageName) {
        byte[] bytes=new byte[0];
        String ret="";
        try {
            File file=new File(this.getClass().getClassLoader().getResource("images/"+imageName).toURI());
            ret=Base64.encode(FileUtils.readFileToByteArray(file));
            
//            BufferedImage image = ImageIO.read(new File(this.getClass().getClassLoader().getResource("images/"+imageName).toURI()));
//            WritableRaster raster = image.getRaster();
//            DataBufferByte data = (DataBufferByte) raster.getDataBuffer();
//            bytes= data.getData();
//            ret=Base64.encode(bytes);
        } catch (IOException ex) {
            Logger.getLogger(StoryService.class.getName()).log(Level.SEVERE, null, ex);
        } catch (URISyntaxException ex) {
            Logger.getLogger(StoryService.class.getName()).log(Level.SEVERE, null, ex);
        }
        return ret;
        //return "";
    }

}
